import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import '../styles/SGOentities.css';
import { handleLogout } from './Auth';
import { supabase } from '../supabaseClient'; 

export default function SGODashboard() {
  const navigate = useNavigate();
  const [entities, setEntities] = useState([]);
  const [loading, setLoading] = useState(false);

  useEffect(() => {
    fetchEntities();
  }, []);

  async function fetchEntities() {
    setLoading(true);
    try {
      const { data, error } = await supabase.from('cso').select('*');
      if (error) throw error;
      setEntities(data);
    } catch (err) {
      console.error('Failed to fetch entities:', err.message);
    } finally {
      setLoading(false);
    }
  }

  return (
    <article>
      <header className="EntityHeader">
        <h1>Clubs Connect</h1>
        <nav>
          <ul className="nav-links">
            <li>
              <button
                onClick={() => navigate('/dashboard/sgo')}
                style={{ background: 'none', border: 'none', color: 'inherit', cursor: 'pointer', padding: 0 }}
              >
                Dashboard
              </button>
            </li>
            <li>
              <button
                onClick={() => navigate('/entities/sgo')}
                style={{ background: 'none', border: 'none', color: 'inherit', cursor: 'pointer', padding: 0 }}
              >
                Entities
              </button>
            </li>
            <li>
              <button
                onClick={() => navigate('/profile/sgo')}
                style={{ background: 'none', border: 'none', color: 'inherit', cursor: 'pointer', padding: 0 }}
              >
                Profile
              </button>
            </li>
            <li>
              <button
                onClick={async () => {
                  await handleLogout();
                  navigate('/auth');     
                }}
                style={{ background: 'none', border: 'none', color: 'inherit', cursor: 'pointer', padding: 0 }}
              >
                Logout
              </button>
            </li>
          </ul>
        </nav>
      </header>

      <main className="content">
        <button
          className="create-entity-btn"
          onClick={() => navigate('/entities/add')}
        >
          Create Entity
        </button>

        <button
          className="create-entity-btn"
          onClick={() => navigate('/entities/page')}
        >
          CSO Page
        </button>

        <section className="entities-list">
          {loading ? (
            <p>Loading entities...</p>
          ) : entities.length === 0 ? (
            <p>No entities found.</p>
          ) : (
            <ul style={{ listStyle: 'none', padding: 0 }}>
              {entities.map((entity) => (
                <li 
                  key={entity.id}
                  onClick={() => navigate(`/CSOPage/${entity.id}`)}
                  style={{
                    cursor: 'pointer',
                    padding: '1rem',
                    marginBottom: '0.5rem',
                    backgroundColor: '#f5f5f5',
                    borderRadius: '8px',
                    transition: 'all 0.2s ease',
                    display: 'flex',
                    alignItems: 'center',
                    gap: '1rem'
                  }}
                  onMouseEnter={(e) => {
                    e.currentTarget.style.backgroundColor = '#e0e0e0';
                    e.currentTarget.style.transform = 'translateX(5px)';
                  }}
                  onMouseLeave={(e) => {
                    e.currentTarget.style.backgroundColor = '#f5f5f5';
                    e.currentTarget.style.transform = 'translateX(0)';
                  }}
                >
                  {entity.logo_url && (
                    <img 
                      src={entity.logo_url} 
                      alt={entity.name}
                      style={{ 
                        width: '50px', 
                        height: '50px', 
                        objectFit: 'contain',
                        borderRadius: '8px'
                      }}
                    />
                  )}
                  <div>
                    <strong style={{ fontSize: '1.1rem', color: '#333' }}>{entity.name}</strong>
                    <br />
                    <span style={{ color: '#666', fontSize: '0.9rem' }}>{entity.cluster}</span>
                    {entity.description && (
                      <p style={{ margin: '0.5rem 0 0 0', color: '#777', fontSize: '0.85rem' }}>
                        {entity.description}
                      </p>
                    )}
                  </div>
                </li>
              ))}
            </ul>
          )}
        </section>
      </main>
    </article>
  );
}
